import React from "react";
import IconLinkedin from "../icons/linkedin"
import IconInstagram from "../icons/instagram";
import IconGitHub from "../icons/github";

const Socials = () => {
    return (
        <div className="flex flex-col gap-4 min-w-32 items-center py-12 justify-end h-svh">
            <div className=" w-40">

                <div className="px-5 py-5 w-full min-h-36 bg-blue-100 drop-shadow-lg">
                <IconLinkedin/>
                <IconInstagram/>
                <IconGitHub/>
                </div>
            </div>

        </div>
    );
};  

export default Socials;
